import React from 'react';
import { Link } from 'react-router-dom';
import PropTypes from 'prop-types';

const OwnerItem = ({ profile: { user } }) => {
  return (
    <div className='profile bg-light'>
      <img src='boy.png' alt='' className='round-img' />
      <div>
        <h2>{user && user.name}</h2>
        <p>
          {user && user.email}{' '}
          {user && user.address && <span> at {user && user.address}</span>}{' '}
        </p>
        <p className='my-1'>
          {' '}
          {user && user.cellPhone && <span>{user && user.cellPhone}</span>}{' '}
        </p>
        <link to={`/profile/${user._id}`} className='btn-btn-primary'>
          View Profile
        </link>
      </div>
    </div>
  );
};

OwnerItem.propTypes = {
  profile: PropTypes.object.isRequired
};

export default OwnerItem;
